<p>从本质上来说，<code>Virtual Dom</code>是一个<code>JavaScript对象</code>，通过对象的方式来表示 <code>DOM</code> 结构。将页面的状态抽象为<code>JS对象</code>的形式，配合不同的渲染工具，使跨平台渲染成为可能。通过<code>事务处理机制</code>，将多次 DOM 修改的结果一次性的更新到页面上，从而有效的减少页面渲染的次数，减少修改 <code>DOM</code> 的重绘重排次数，提高渲染性能。</p>
